export = MatchResult;
/**
 * The result of a window match by the agent.
 */
declare class MatchResult {
    /**
     * @param {object} result
     * @param {boolean} [result.asExpected]
     * @param {number} [result.windowId]
     */
    constructor({ asExpected, windowId }?: {
        asExpected: boolean;
        windowId: number;
    });
    _asExpected: boolean;
    _windowId: number;
    /**
     * @return {boolean}
     */
    getAsExpected(): boolean;
    /**
     * @param {boolean} value
     */
    setAsExpected(value: boolean): void;
    /**
     * @return {number}
     */
    getWindowId(): number;
    /**
     * @param {number} value
     */
    setWindowId(value: number): void;
    /**
     * @override
     */
    toJSON(): any;
    /**
     * @override
     */
    toString(): string;
}
